import React from 'react';
import { Modal, ModalBody, ModalHeader } from 'reactstrap';
import IntlMessages from '../../../../../util/IntlMessages';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import Auxiliary from '../../../../../util/Auxiliary';
import { connect } from 'react-redux';
import { KeyboardDatePicker, MuiPickersUtilsProvider } from '@material-ui/pickers';
import DateFnsUtils from '@date-io/moment';
import MenuItem from '@material-ui/core/MenuItem';

const schoolSessionList = [
  {
    value: 'Trimestre 1',
    id: 1,
  },
  {
    value: 'Trimestre 2',
    id: 2,
  },
  {
    value: 'Trimestre 3',
    id: 3,
  },
  {
    value: 'Semestre 1',
    id: 4,
  },
  {
    value: 'Semestre 2',
    id: 5,
  },
];
class EditUsers extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Auxiliary>
        <Modal isOpen={this.props.values.openEdit}

         >
          <ModalHeader 
       toggle={this.props.handleToggle}
          className="modal-box-header bg-primary text-white">
            {<IntlMessages id="modal.modif.module.school.session" />}
          </ModalHeader>
          <ModalBody>
            <h3>helloooodo</h3>
          </ModalBody>
        </Modal>
      </Auxiliary>
    );
  }
}

export default connect()(EditUsers);
